ll_type":"markdown","id":"c32413e5","metadata":{"papermill":{"duration":0.010375,"end_time":"2023-05-18T00:54:05.868786","exception":false,"start_time":"2023-05-18T00:54:05.858411","status":"completed"},"tags":[]},"source":["# Act"]},{"cell_type":"markdown","id":"b65fc487","metadata":{"papermill":{"duration":0.010439,"end_time":"2023-05-18T00:54:05.889695","exception":false,"start_time":"2023-05-18T00:54:05.879256","status":"completed"},"tags":[]},"source":["As we have shared findings and facts throughout the Analyze step, below are the updated recommendations, based on the information above.\n","\n","Recommendations...\n","\n","* More women demand Activity tracking devices than men but still use them less frequently than men.\n","    1. **Promote inclusivity and diverse representation in marketing campaigns to highlight the benefits of activity-tracking devices specifically for women, showcasing real women from various backgrounds and lifestyles to increase relatability and encourage engagement.**\n","* Tracking daily activity more than any other option, followed by participants sleeping routines.\n","    2. **Enhance the user experience by developing intuitive features within the activity tracking app that prioritize and simplify the tracking of daily activities, while also providing comprehensive insights and recommendations based on sleep patterns to further motivate and empower users to achieve their health and wellness goals.**\n","* The highest numbers go for lying, with More than 16 hours of average sleep or lying.\n","    3. **Introduce an awareness reminder feature within the app that tracks users' sedentary time. It sends regular prompts encouraging them to take breaks, move around, and engage in light physical activity, fostering a more active and healthy lifestyle while minimizing prolonged periods of inactivity.**\n","* Tuesday and Saturday are the Most days calories burned,  while Thursday is the Least.\n","     4. **Develop tailored recommendations and incentives to encourage more consistent physical activity throughout the week, particularly on days like Thursday when calorie burn is lower, aiming to achieve a more balanced and sustained level of calorie expenditure.**\n"]},{"cell_type":"markdown","id":"0f34d01c","metadata":{"papermill":{"duration":0.010557,"end_time":"2023-05-18T00:54:05.911383","exception":false,"start_time":"2023-05-18T00:54:05.900826","status":"completed"},"tags":[]},"source":["                    .'. THANK YOU FOR THE TIME .'."]},{"cell_type":"markdown","id":"f466f321","metadata":{"papermill":{"duration":0.010327,"end_time":"2023-05-18T00:54:05.932161","exception":false,"start_time":"2023-05-18T00:54:05.921834","status":"completed"},"tags":[]},"source":["Ayman M. Sabek\n","\n","Google Capstone Project - Data Analytics Course\n","\n","May 2023"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":49.085707,"end_time":"2023-05-18T00:54:06.064701","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-05-18T00:53:16.978994","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}